uniform float iTime;
uniform vec2 iResolution;

// 12 Locked-In Stability Parameters
uniform float u_zoom;           
uniform float u_camera_dist;    
uniform float u_camera_height;  
uniform float u_complexity;     
uniform float u_melt_speed;     
uniform float u_chrome_shine;   
uniform float u_exposure;       
uniform float u_glow_power;     
uniform float u_hue_cycle;      
uniform float u_fog_depth;      
uniform float u_chroma;         
uniform float u_vignette;       

// New Madness Parameters
uniform float u_terrain_chaos;  // Madness multiplier
uniform float u_spikes;         // Sharpness of the fractal landscape
uniform float u_glitch_freq;    // Frequency of tectonic shifts

out vec4 fragColor;

mat2 rot(float a) { return mat2(cos(a), -sin(a), sin(a), cos(a)); }

// Landscape of Madness Map
float map(vec3 p) {
    float t = iTime * u_melt_speed;

    // Distort the "ground" plane with madness
    float floorHeight = -1.5;
    float d = p.y - floorHeight;

    // Add infinite repetition but skewed
    vec3 q = p;
    q.xz = mod(q.xz + 5.0, 10.0) - 5.0;

    // Fractal warping logic
    float s = 1.0;
    for(int i = 0; i < 4; i++) {
        q = abs(q) - (0.5 + 0.2 * sin(t * u_glitch_freq + float(i)));
        q.xz *= rot(t * 0.2 + float(i) * u_terrain_chaos);
        q.yz *= rot(t * 0.1);

        float r2 = dot(q, q);
        // The core "Madness" multiplier - pushing complexity into the spikes
        float k = (1.5 * u_complexity) / clamp(r2, 0.15, 1.2);
        q *= k;
        s *= k;

        // Infusing spikes and irregular terrain
        float fractalPart = (length(q.xy) - u_spikes) / s;
        d = min(d, fractalPart);
    }

    // Secondary layer of noise-like spikes
    d = mix(d, d + sin(p.x * 10.0 + t) * sin(p.z * 10.0) * 0.05, u_terrain_chaos);

    return d;
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.005, 0);
    return normalize(vec3(map(p+e.xyy)-map(p-e.xyy), map(p+e.yxy)-map(p-e.yxy), map(p+e.yyx)-map(p-e.yyx)));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // --- STABLE CAMERA RIG ---
    // Drunken, mad camera movement
    float orbit = iTime * 0.05;
    float verticalOsc = sin(iTime * 0.2) * 2.0;
    vec3 ro = vec3(sin(orbit) * u_camera_dist, u_camera_height + verticalOsc, cos(orbit) * u_camera_dist);
    vec3 ta = vec3(sin(iTime * 0.1) * 2.0, -1.0, cos(iTime * 0.1) * 2.0);

    vec3 fwd = normalize(ta - ro);
    vec3 side = normalize(cross(vec3(0, 1, 0), fwd));
    vec3 up = cross(fwd, side);
    vec3 rd = normalize(fwd * u_zoom + uv.x * side + uv.y * up);

    // --- AGGRESSIVE MARCHING ---
    float dist = 0.01, d, glow = 0.0;
    for(int i = 0; i < 90; i++) {
        vec3 p = ro + rd * dist;
        d = map(p);

        // Madness Glow: Pulsating with time
        glow += exp(-max(d, 0.0) * (2.0 + sin(iTime))) * u_glow_power;

        if(d < 0.001 || dist > 50.0) break;
        dist += d * 0.6; 
    }

    // Sky gradient: Blood and Void
    vec3 sky = mix(vec3(0.02, 0.0, 0.01), vec3(0.1, 0.02, 0.05), uv.y + 0.5);
    vec3 col = sky;

    if(dist < 50.0) {
        vec3 p = ro + rd * dist;
        vec3 n = getNormal(p);
        vec3 v = normalize(ro - p);

        float diff = max(dot(n, normalize(vec3(1, 5, 2))), 0.0);
        float fres = pow(1.0 - max(dot(n, v), 0.0), 5.0);

        // Madness Palette: Shifting between necrotic greens and hellish reds
        vec3 baseCol = mix(vec3(0.2, 0.05, 0.1), vec3(0.1, 0.8, 0.4), u_hue_cycle);
        baseCol = mix(baseCol, vec3(0.9, 0.1, 0.1), sin(p.y * 2.0 + iTime) * 0.5 + 0.5);

        col = baseCol * diff;
        col += vec3(0.8, 0.9, 1.0) * fres * u_chrome_shine;

        // Specular highlight
        col += vec3(1.0) * pow(max(dot(n, normalize(vec3(0, 1, 0))), 0.0), 64.0) * u_chrome_shine;
    }

    // Atmospheric Polish: Ethereal Madness
    vec3 glowCol = mix(vec3(1.0, 0.1, 0.1), vec3(0.1, 0.5, 1.0), u_hue_cycle);
    col += glow * 0.015 * glowCol;

    float fog = 1.0 - exp(-dist * (2.0 / u_fog_depth));
    col = mix(col, sky, fog);

    // Post-Process
    col *= u_exposure;

    // Madness Glitch: Color Separation
    float shift = u_chroma * sin(iTime * 2.0);
    col.r = texture(iChannel0, uv + vec2(shift, 0.0)).r * col.r; // Placeholder for logic if texture existed, but we stick to procedural
    col.g *= (1.0 - u_chroma);
    col.b *= (1.0 + u_chroma);

    // High contrast curve
    col = pow(smoothstep(-0.1, 1.1, col), vec3(0.4545));
    col *= 1.1 - length(uv) * u_vignette;

    fragColor = vec4(clamp(col, 0.0, 1.0), 1.0);
}
